import React from "react";
import { PieChart } from "react-d3-components";

class BarChartContainer extends Component{

  state = {
    data: {}
  };

  componentDidMount() {
    axios.get('http://localhost:5000/restaurants/vis/')
        .then(res => {
            const data = res.data;
            this.setState({data});
        })
  }

  render(){
    return(
      <PieChart
                data={data}
                width={600}
                height={400}
                margin={{top: 10, bottom: 10, left: 100, right: 100}}
                sort={null}
                />

    )
  }

}

